This one is easy - odin_actor does not have a specific message type or trait. Anything that is Send + Debug + 'static can be a message. The Send constraint is obvious as we pass messages between concurrent tasks (actors). TheDebug constraint is only for generic tracing/debugging support. The message type needs to be static since it is part of the receiver actors definition. Some message sender methods do also require Clone as all sender methods do consume the message argument. Should cloning be inefficient the message can also be an Arc<T>. Since an actor typically processes more than one message we need to wrap all of its input message types into an enum. This message set becomes part of the generic Actor<MsgSet,ActorState> type. Defining the message set is supported by the define_actor_msg_set!{..} macro: define_actor_msg_set! { MyActorMsg = Msg1 | Msg2 } which roughly expands to // automatically generated code
enum MyActorMsg { Msg1(Msg1), // user messages... Msg2(Msg2), _Start_ (_Start_), // system messages... ... _Terminate_ (_Terminate_) }
impl From<Msg1> for MyActorMsg { ... }
impl From<Msg2> for MyActorMsg { ... }
... The macro automatically adds variants for each of the system messages _Start_ - sent by the ActorSystem to indicate that all actors have been instantiated and should start to process _Timer_ - sent by timers created from within the actor _Exec_ - a generic message that executes the provided closure within the actor task _Pause_ and _Resume_ - can be used by actor systems that replay content _Terminate_ - sent by the ActorSystem to indicate the application is about to shut down System messages don't need to be explicitly handled. They are sent either by the ActorSystem (e.g. _Start_) or implicitly by Actor methods such as start_timer(..) or exec(..). The message set name (e.g. MyActorMsg) is then used to define the actor like so: impl_actor! { match msg for Actor<MyActorMsg,MyActorState> as Msg1 => ... // handle message 'msg' of type 'Msg1' Msg2 => ...
} Both define_actor_msg_set!{..} and impl_actor!{..} automatically translate generic message types (e.g. Query<Q,A>) into valid variant names of the actor message set. Although this mapping is readable and intuitive the programmer does not need to know (other than to understand related compiler error messages). Using an enum to encode all possible input messages for an actor also explains why message types should not be large. Not only would this increase clone() cost but it also would enlarge the message set enum, which is sized according to its largest variant. Since this message set enum is the type of the actor mailbox (channel) this size matters - a Rust enum is sized according to its largest variant. If the ratio of max to min size of variants is too large then the channel can waste a lot of memory. If this is a problem we can always wrap (part of) large messages within heap-allocated containers (Box, Arc, Vec etc.) which collapses the size of the wrapped data to a pointer.

